(2, , 'Jarin', 'Tabata', 'Creative Director', 'New York', 'SY', '917-513-6610', 'jtabata@sypartners.com', 'a', 'b', 'c', '2013-08-13', 'I''m a recent returnee to the land of the free, having survived the deleterious effects of socialism in Japan, the Netherlands and the UK for over 20 years. I grew up in the West (Hawaii, California and Colorado mostly) but now giving the other coast a chance.\r\n<br><br>My background is in digital design and development, in sectors ranging from publishing to advertising. I''ve pushed my fair share of pixels and I''m looking forward to exploring the myriad ways this medium and its approach can influence and enable SYP''s thinking and methodology.\r\n<br><br>When I''m not waxing heavy about the beautiful potential of design and code, there seems to be a constant stream of interesting things, people and ideas passing through my field of awareness. How can anyone be bored?', );
